INSERT INTO `movies` VALUES (33,'Mission: Impossible - The Final Reckoning','Action, Adventure','English',169,'2025-06-13','Our lives are the sum of our choices. Tom Cruise is Ethan Hunt in Mission: Impossible - The Final Reckoning.',16.00,'1749810939758_9b327276-3d91-4382-a580-61940b59c734.jpeg'),(34,'The Accountant 2','action, crime, drama, mystery','russian',132,'2025-06-09','Christian Wolff applies his brilliant mind and illegal methods to reconstruct the unsolved puzzle of a Treasury chief\'s murder.',17.00,'1749808292588_0f9d67cc-e562-4bd9-8aa7-5dea270e42fa.jpeg'),(35,'Thunderbolts','Action, Crime, Adventure','English',127,'2025-06-20','After finding themselves ensnared in a death trap, an unconventional team of antiheroes must go on a dangerous mission that will force them to confront the darkest corners of their pasts.',16.00,'1749811009839_fa340858-e31b-4827-a019-66d8c3d2b0b9.jpg'),(36,'Final Destination Bloodlines','horror','english',110,'2025-05-01','Plagued by a recurring violent nightmare, a college student returns home to find the one person who can break the cycle and save her family from the horrific fate that inevitably awaits them.',18.00,'1749811046914_d59735ae-1c88-4a0f-97c8-b87bbfc8c57b.jpg'),(37,'Lilo & Stitch','Action, Drama, Adventure, Animation','English',108,'2025-05-23','A lonely Hawaiian girl befriends a runaway alien, helping to mend her fragmented family.',15.00,'1749811054950_5ae030d7-0baa-46ec-9e7f-74b985945e32.jpg'),(38,'How to Train Your Dragon','Action, Adventure, Animation','English',116,'2025-06-13','On the rugged isle of Berk, a Viking boy named Hiccup defies centuries of tradition by befriending a dragon named Toothless. However, when an ancient threat emerges that endangers both species, Hiccup\'s friendship with Toothless becomes the key to forging a new future. Together, they must navigate the delicate path toward peace, soaring beyond the boundaries of their worlds and redefining what it means to be a hero and a leader.',17.00,'1749811067110_66f416bc-1c35-40b4-81fa-1d7678e6f9e1.jpg'),(39,'Keluang Man','Action','Malay',137,'2025-05-31','Borhan, a former patient at a mental hospital in Tampoi, lives a life as a mysterious hero named Keluang Man. He uses his martial arts expertise and his wits to fight crime in the small town of Kluang. Borhan must face a major threat when a secret criminal organisation emerges, led by his archenemy, Shamsir. Aided by his friend Inspector Sahab, Borhan struggles with internal conflicts, questions about his sanity, and the challenges of being a true protector.',16.00,'1749811077005_4366c5a5-b4a6-49dc-8dfc-0d4fd560441e.jpg'),(40,'Ejen Ali The Movie 2: Misi Satria','Action, Animation','Malay',115,'2025-06-10','Ejen Ali is appointed as the pilot of Project Satria, a new armoured suit with the help of an Artificial Intelligence programme specially designed to optimise the physical performance and mental skills of MATA agents while carrying out their secret missions.',17.00,'1749811092987_7febfccf-c15c-4966-b0ab-b347fb1ea087.jpg'),(41,'Gantung: Musketeer Code','Horror, Mystery','Malay',118,'2025-06-05','Khalil, a famous film director, receives a phone call from his former schoolmate, Farah, requesting him to return to his old school because of some unresolved matters. Khalil recalls a tragedy that happened at his school 10 years ago where he, along with three of his best friends - Gibbs, KJ and Troll - were accused of being the cause of Ratna`s suicide. Ratna had taken her own life in the school auditorium by hanging herself.',14.00,'1749811102427_50b4fc73-55ae-478d-a16e-efbd1e6d2057.jpg'),(42,'The Ritual','Horror','English',109,'2025-06-06','Two priests - one questioning his faith and one reckoning with a troubled past - must put aside their differences to save a possessed young woman through a difficult and dangerous series of exorcisms.',17.00,'1749811111922_3a49dbad-a593-4573-a61e-14d3d9831ce7.jpg'),(43,'Karate Kid: Legends','Action','English',94,'2025-06-05','After a family tragedy, kung fu prodigy Li Fong is uprooted from his home in Beijing and forced to move to New York City with his mother. Li struggles to let go of his past as he tries to fit in with his new classmates, and although he doesn`t want to fight, trouble seems to find him everywhere. When a new friend needs his help, Li enters a karate competition - but his skills alone aren`t enough. Li`s kung fu teacher Mr. Han enlists original Karate Kid Daniel LaRusso for help, and Li learns a new way to fight, merging their two styles into one for the ultimate martial arts showdown.',16.00,'1749811121855_2afa31d2-a84a-4f2f-958b-6e428db6a774.jpg'),(44,'From The World Of John Wick: Ballerina','Action','English',125,'2025-06-06','Set in the John Wick universe, ballerina-assassin Rooney seeks revenge against the people who killed her family.',16.00,'1749811220568_2d167edb-d31b-42f7-9297-db6b019d418a.jpg'),(45,'Laknat','Horror','Malay',92,'2025-06-05','All efforts to find Laila are hopeless. The devil appears as a member of Luth`s family and offers help that Luth cannot refuse. Imagination brings Laila back to life to tell the reason for the terrible loss and death, and that is the greatest crime. Luth loses his sanity so much that the revenge he takes against his fiancee Murni and the death of his friend Nafis are also just tricks of the devil.',16.00,'1749811243889_c4ef048a-bc5f-4528-baf3-cd50c768335a.jpg'),(46,'Behind the Shadows','Crime, Drama, Mystery','English',102,'2025-06-12','It tells the story of private detective Au-Yeung Wai Yip who fights to investigate the truth of an unsolved case.',16.00,'1749811258672_9afe0676-fbc4-4d1f-819a-77e7c7feb2fe.jpg'),(47,'Thug Life','action, drama, adventure, animation','hindi',165,'2025-06-06','Gang leader Sakthivel adopts Amaran after saving him during a gang war. Years later, Sakthivel survives an assassination attempt and suspects Amaran\'s involvement, leading to a conflict of loyalty and revenge.',16.00,'1749811271445_a09bf61c-945d-4261-a6b6-4576e4bb199e.jpg'),(48,'DAN DA DAN: Evil Eye','adventure, animation','japanese',99,'2025-06-02','Momo, a high school girl from a family of spirit mediums, and her classmate Okarun, an occult geek, set out on their latest adventure, traveling to a hot springs town home rented by Jiji, Momo`s childhood friend and former crush. They plan to solve the mystery surrounding his family. When they arrive, strange locals derail their investigation before it can begin, and the group soon learns there`s more lurking under the surface of the town than they could possibly have imagined.',16.00,'1749899616948_d84804c8-e846-4ea7-8a6b-f2f456f30970.jpg');
